static void
bt_source_sv_init ()
	{
	Objid				my_id;
	char				intarrvl_rate_string [128], packet_size_string [128];
	char				start_time_string [128];
	OmsT_Dist_Handle	start_time_dist_handle;
	int 				i, dest, slave_addr;
	int 				num_acl_rows, num_sco_rows;
	char 				str0[128];
	
	Objid	acl_traf_params, sco_traf_params;
	Objid   traffic_id[8];


	/**	Initializes state variables associated with		**/
	/**	this process model.								**/
	FIN (bt_source_sv_init ());

	/*	Determine the object ID.*/
	my_id = op_id_self ();

	pkts_sent = 0;
	num_acl_rows = 0;
	num_sco_rows = 0;

	/* Build tables of traffic parameters for acl and sco connections */
	
	/* First get the ids of the attribute sets */
	op_ima_obj_attr_get (my_id, "Master->Slave ACL Traffic", &acl_traf_params);
	op_ima_obj_attr_get (my_id, "Master->Slave SCO Traffic", &sco_traf_params);


	num_acl_rows = op_topo_child_count (acl_traf_params, OPC_OBJTYPE_GENERIC);
	num_sco_rows = op_topo_child_count (sco_traf_params, OPC_OBJTYPE_GENERIC);
	
	
	if (num_sco_rows > 0)
		op_ima_obj_attr_get (my_id, "Voice Start Time", &sco_start);
	
	
	for (i=0; i<num_acl_rows; i++)
		{
		/* Get  row objid */
		traffic_id[i] = op_topo_child (acl_traf_params, OPC_OBJTYPE_GENERIC, i);
		
		/* Get the destination address	*/	
		op_ima_obj_attr_get (traffic_id[i], "Destination Address", &Acl_table[i].dest);
		
		
		/* Check for valid destination address */
		if (Acl_table[i].dest == -1)
			op_sim_end("Destination address for Data traffic not set at Master's stochastic source","Check configuration.","","");
		
		
		/* get the start time */
		op_ima_obj_attr_get (traffic_id[i], "Start Time", start_time_string);
		
		if (strcmp (start_time_string, "Never") != 0)
			{
			start_time_dist_handle = oms_dist_load_from_string (start_time_string);
			Acl_table[i].start_time = oms_dist_outcome (start_time_dist_handle);
			}
		else
			{
			Acl_table[i].start_time = -1.0;
			}
		
		/* if there will be traffic to this destination, find out what type */
		if (Acl_table[i].start_time >= 0)
			{
			/* First make sure start time will allow initialization to complete */
			if(Acl_table[i].start_time < .1)
				{
				Acl_table[i].start_time = .1;
				sprintf(str0, "Master source for destination %d: start time may not allow initialization to complete.\n Resetting start time to .1 seconds. ", Acl_table[i].dest); 
				op_prg_odb_print_major (str0, OPC_NIL, OPC_NIL, OPC_NIL);
				}
			
			/* Determine the stop time for data traffic generation.	*/
			op_ima_obj_attr_get (traffic_id[i], "Stop Time", &Acl_table[i].stop_time);
			if (Acl_table[i].stop_time == -1.0)
				Acl_table[i].stop_time = OPC_DBL_INFINITY;
			}
			
		if (Acl_table[i].stop_time > Acl_table[i].start_time)
			{
			/* Load the distributions used to determine packet generation */

			op_ima_obj_attr_get (traffic_id[i], "Interarrival Time", intarrvl_rate_string);
			Acl_table[i].int_arrival = oms_dist_load_from_string (intarrvl_rate_string);
				
			op_ima_obj_attr_get (traffic_id[i], "Packet Size", packet_size_string);
			Acl_table[i].pkt_size =  oms_dist_load_from_string (packet_size_string);
			}
				 
		}/* End acl attributes */
		
	for (i=0; i<num_sco_rows; i++)
		{
		/* Get  row objid */
		traffic_id[i] = op_topo_child (sco_traf_params, OPC_OBJTYPE_GENERIC, i);
		
		/* Get the destination address	*/	
		op_ima_obj_attr_get (traffic_id[i], "Destination Address", &dest);
		Sco_table[i].dest = dest;
		
		/* Voice traffic is constant - no distributions 	*/
		
		op_ima_obj_attr_get (traffic_id[i], "Interarrival Time", &Sco_table[i].int_arrival);
				
		op_ima_obj_attr_get (traffic_id[i], "Packet Size", &Sco_table[i].pkt_size);
			 
		}/* End sco attributes */
	
	for (i=0; i<7; i++)
		{
		/* Initialize dimensioned packet count */
		pk_sent_dim[i] = 0;
		}


	/*	Initialize the packet generation status statistic	*/
	/*	to indicate that currently there are no packets 	*/
	/*	being generated.									*/
	pksize_stathandle = op_stat_reg ("Stochastic.Packet Generation Status", OPC_STAT_INDEX_NONE, OPC_STAT_LOCAL);
	op_stat_write (pksize_stathandle, (double) OPC_FALSE);
		
	/* Initilaize the statistic handles to keep	*/
	/* track of traffic Sourced by this process.	*/
	bits_sent_stathandle 		= op_stat_reg ("Stochastic.Traffic Sent (bits)",		OPC_STAT_INDEX_NONE, OPC_STAT_LOCAL);
	bitssec_sent_stathandle 	= op_stat_reg ("Stochastic.Traffic Sent (bits/sec)",	OPC_STAT_INDEX_NONE, OPC_STAT_LOCAL);
	pkts_sent_stathandle 		= op_stat_reg ("Stochastic.Traffic Sent (packets)",		OPC_STAT_INDEX_NONE, OPC_STAT_LOCAL);
	pktssec_sent_stathandle 	= op_stat_reg ("Stochastic.Traffic Sent (packets/sec)",	OPC_STAT_INDEX_NONE, OPC_STAT_LOCAL);
	acl_bitssec_sent_stathandle 	= op_stat_reg ("Stochastic.Data Traffic Sent (bits/sec)",		OPC_STAT_INDEX_NONE, OPC_STAT_LOCAL);
	acl_pkts_sent_stathandle 		= op_stat_reg ("Stochastic.Data Traffic Sent (packets)",		OPC_STAT_INDEX_NONE, OPC_STAT_LOCAL);
	sco_bitssec_sent_stathandle 	= op_stat_reg ("Stochastic.Voice Traffic Sent (bits/sec)",		OPC_STAT_INDEX_NONE, OPC_STAT_LOCAL);
	sco_pkts_sent_stathandle 		= op_stat_reg ("Stochastic.Voice Traffic Sent (packets)",		OPC_STAT_INDEX_NONE, OPC_STAT_LOCAL);

	bits_sent_gstathandle 		= op_stat_reg ("Stochastic.Traffic Sent (bits)",		OPC_STAT_INDEX_NONE, OPC_STAT_GLOBAL);
	bitssec_sent_gstathandle 	= op_stat_reg ("Stochastic.Traffic Sent (bits/sec)",	OPC_STAT_INDEX_NONE, OPC_STAT_GLOBAL);
	pkts_sent_gstathandle 		= op_stat_reg ("Stochastic.Traffic Sent (packets)",		OPC_STAT_INDEX_NONE, OPC_STAT_GLOBAL);
	pktssec_sent_gstathandle 	= op_stat_reg ("Stochastic.Traffic Sent (packets/sec)",	OPC_STAT_INDEX_NONE, OPC_STAT_GLOBAL);
				
	for (slave_addr=0; slave_addr<7; slave_addr++)
		pkts_sent_dimstathandle[slave_addr] = op_stat_reg ("Stochastic.Traffic by Slave (packets)",	slave_addr, OPC_STAT_LOCAL);

	num_sco_connections = num_sco_rows;
	num_acl_connections = num_acl_rows;
	FOUT;
	}
/*------------------------------------------------------------------------------------
 * Function:	wpan_fuzzy_step()
 *
 * Description:	Calls the membership functions that are required to access fuzzy system 
 *
 * No parameters   
 *-----------------------------------------------------------------------------------*/

static void wpan_fuzzy_step(float *crisp_inputs, float *crisp_outputs)
{
	int in_index,rule_index,out_index;
	float in_val;
	
	FIN(wpan_fuzzy_step);
	
	for (in_index = 0;in_index < num_inputs;in_index++)
	{
		wpan_fuzzify_input(in_index,crisp_inputs[in_index]); 
	}
	for (rule_index = 0;rule_index < num_rules;rule_index++)
	{
		wpan_eval_rule(rule_index);
	}
	for (out_index = 0;out_index < num_outputs;out_index++)
	{
		crisp_outputs[out_index] = wpan_defuzzify_output(out_index, crisp_inputs);
		strcpy(fuzzyGroupCoOrdinator[0].nodeName, "Risk Group");
		fuzzyGroupCoOrdinator[0].payLoad = crisp_outputs[out_index];
		op_stat_write(risk_pkts_rcv_stathandle,crisp_outputs[out_index]);
		//if (TRACE) 
			printf("crisp_output[%d] = %f\n", out_index, crisp_outputs[out_index]);
	}
	
	FOUT;
	
}

/*------------------------------------------------------------------------------------
 * Function:	wpan_fuzzify_input()
 *
 * Description:	Fuzzifies the input membership functions 
 *
 * No parameters   
 *-----------------------------------------------------------------------------------*/

static void wpan_fuzzify_input(int in_index,float in_val)
{
	int i;
	
	FIN(wpan_fuzzify_input);
//	if (TRACE) printf("Fuzzify; input #%d crisp value %f\n", in_index, in_val);
	for (i = 0;i < num_input_mfs[in_index] ;i++)
	{
		fuzzy_inputs[in_index][i] = wpan_get_membership_value(in_index,i,in_val);
//		if (TRACE) printf( "Membership function #%d grade %f\n", i, fuzzy_inputs[in_index][i]);
	}
	FOUT;
}


/*------------------------------------------------------------------------------------
 * Function:	wpan_get_membership_value()
 *
 * Description:	Fuzzifies the input membership functions 
 *
 * Output: Membership value of the input function   
 *-----------------------------------------------------------------------------------*/

static float wpan_get_membership_value(int in_index,int mf_index,float in_val)
{

	FIN(wpan_get_membership_value);
	if (in_val < inmem_points[in_index][mf_index][0]) FRET(0);
	if (in_val > inmem_points[in_index][mf_index][3]) FRET(0);
	if (in_val <= inmem_points[in_index][mf_index][ 1 ]) 
	{
		if (inmem_points[in_index][mf_index][0] == inmem_points[in_index][mf_index][ 1 ])
			{
				FRET(1);
			}
		else
			{
				FRET((in_val - inmem_points[in_index][mf_index][0]) /(inmem_points[in_index][mf_index][1 ] - inmem_points[in_index][mf_index][0]));	
			}
	}
	if (in_val >= inmem_points[in_index][mf_index][2]) 
	{
		if (inmem_points[ in_index] [mf_index] [ 2] == inmem_points[ in_index ] [ mf_index ] [ 3 ])
			{
				FRET(1);
			}
		else
			{
				FRET((inmem_points[in_index][mf_index][3] - in_val) / (inmem_points[in_index][mf_index][3] -inmem_points[in_index][mf_index][2]));
			}
	}
	FRET(1);
}

/*------------------------------------------------------------------------------------
 * Function:	wpan_eval_rule()
 *
 * Description:	Evaluates the rules for the membership functions
 *
 * No parameters   
 *-----------------------------------------------------------------------------------*/


static void wpan_eval_rule(int rule_index) 
{
	int in_index,out_index,mf_index,ant_index,con_index;
	int val; 
	float rule_strength = 1;
	
	FIN(wpan_eval_rule);
	for (ant_index = 0;ant_index <num_rule_ants[rule_index];ant_index++) 
	{
		val = Rules[rule_index].antecedent[ant_index];
	
		//printf("Val = %d\n", val);
		in_index = (val & 0x07);
		//printf("In index = %d\n", in_index);

		mf_index = ((val & 0x38 )>> 3); //0x38 = 56
		//printf("Mf index = %d\n", mf_index);
		rule_strength = MIN(rule_strength,fuzzy_inputs[in_index][mf_index]); /* AND operator */
		//printf("Rule Strength = %lf\n", rule_strength);
	}
	rule_strengths[rule_index] = rule_strength;
//	if (TRACE) printf("Rule #%d strength %f\n", rule_index, rule_strength);
	for (con_index = 0;con_index < num_rule_cons[rule_index];con_index++) 
	{
		val = Rules[rule_index].consequent[con_index];
		out_index = (val & 0x03);
		//printf("Out index : %d\n", out_index);
		mf_index = ((val & 0x38)>>3);
		//printf("Mf index : %d\n", mf_index);
		//printf("fuzzy outputs :out index : %d mf index : %d value: %f\n", out_index, mf_index, fuzzy_outputs[out_index][mf_index]);
		fuzzy_outputs[out_index][mf_index] =MAX(fuzzy_outputs[out_index][mf_index],rule_strengths[rule_index]);
	}
	
	FOUT;
}


/*------------------------------------------------------------------------------------
 * Function:	wpan_defuzzify_output()
 *
 * Description:	Evaluates the rules for the membership functions
 *
 * Output: Defuzzified output value   
 *-----------------------------------------------------------------------------------*/

static float wpan_defuzzify_output(int out_index,float *inputs)
{
	float summ = 0;
	float product = 0;
	float temp1,temp2;
	int mf_index,in_index;
	FIN(wpan_defuzzify_output);
	
//	if (TRACE) printf("Defuzzify: output #%d\n", out_index);
	for (mf_index = 0;mf_index < num_output_mfs[out_index] ;mf_index++) 
	{
		temp1 = fuzzy_outputs[out_index][mf_index];
		temp2 = outmem_points[out_index][mf_index][0];
		summ = summ + temp1;
		product = product + (temp1 * temp2);
//		if (TRACE) printf("Membership function #%d grade %f\n", mf_index, fuzzy_outputs[out_index][mf_index]);
			fuzzy_outputs[out_index][mf_index] = 0;
	}
	if(summ>0) 
	{
		crisp_outputs[out_index] = product / summ;
		FRET(crisp_outputs[out_index]);
	}
	else 
	{
		if(NO_RULES)
		{
			printf("No rules fire for:\n");
			for (in_index = 0;in_index < num_inputs;in_index++)
				printf("Input #%d=%f", in_index,inputs[in_index]);
			printf("\n");
		}
	FRET(crisp_outputs[out_index]);
	}
}

